import React, { Component } from 'react';
import styled from 'styled-components';

function OurTeam() {
    return(
        <OurTeamSection>
            <BannerTeam>
                <BannerLetter>t</BannerLetter>
                <BannerLetter>e</BannerLetter>
                <BannerLetter>a</BannerLetter>
                <BannerLetter>m</BannerLetter>
            </BannerTeam>

            <OurTeamContainer className='container'>
                <HeaderContainer className='row'>
                    <HeaderContent>Our Team</HeaderContent>
                    <Line/>
                </HeaderContainer>


            </OurTeamContainer>
        </OurTeamSection>
    );
}

const OurTeamSection = styled.section`
    position: relative;
    padding: 45px 15px;
`

const BannerTeam = styled.div`
    position: absolute;
    left: 10%;
`

const BannerLetter = styled.span`
    font-size: 50px;
    z-index: -1;

    font-size: 250px;
    font-weight: 900;
    font-family: sans-serif;
    letter-spacing: 10px;
`

const OurTeamContainer = styled.div``

const HeaderContainer = styled.div``

const HeaderContent = styled.div`
    width: 100%;
    color: #fff;
    font-size: 30px;
    font-family: sans-serif;

    text-align: center;
`
const Line = styled.div`
    width: 40px;
    height: 2px;
    background: #aceb2f;

    margin: auto;

`

export default OurTeam;
